import React from 'react'
import Header from '../Components/Header'
import DetailBook from '../Components/DetailBook'

const BookAdd = () => {
  return (
    <div>
      <Header />
      <h1 className='text-center'></h1>
      <DetailBook />
    </div>
  )
}

export default BookAdd
